import React from 'react'
import { Route } from 'react-router-dom'

const OnlyPublicRoute = ({ component: Component, layout: Layout, ...rest}) => {
  return (
    <Route
      {...rest}
      render={(props) => (
        <Layout><Component {...props} /></Layout>
      )}
    />
  )
}

export default OnlyPublicRoute
